import "react-datepicker/dist/react-datepicker.css";
import "./styles.css";
import { React, useState } from "react";

import { library } from "@fortawesome/fontawesome-svg-core";
import { fab } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

library.add(fab);

export default function App() {
  const [date, setDate] = useState("");
  const [lucky, setLucky] = useState(0);
  const [result, setResult] = useState("VIEW THE RESULT HERE !!!");
  const [imgURL, setImgURL] = useState(
    "data:image/jpeg;base64,"
  );

  const digitsSum = (string) => {
    let sum = 0;

    for (let digit of string) {
      sum += Number(digit);
    }
    return sum;
  };

  function calculate() {
    let sum = 0;

    const digits = date.split("-");

    for (let digit of digits) {
      sum += digitsSum(digit);
    }
    if (Number(lucky) <= 0) {
      setImgURL(
        "data:image/jpeg;base64,"
      );
      setResult("Enter a positive number!!");
    } else if (sum % Number(lucky) === 0 && date !== "") {
      setImgURL(
        "data:image/jpeg;base64,"
      );
      setResult("YAY!!! " + date + " is a Lucky Birthday!!!!");
    } else if (Number(lucky) !== 0 && date !== "") {
      setImgURL(
        "data:image/jpeg;base64,"
      );
      setResult("OH-NO!!! " + date + " is not a Lucky Birthday!!!");
    } else {
      setImgURL(
        "data:image/jpeg;base64,"
      );
      setResult("Enter a valid date and number!!");
    }
  }

  const assignDate = (e) => {
    setDate(e.target.value);
  };

  function assignLucky(event) {
    setLucky(event.target.value);
  }

  function buttonHandler() {}

  return (
    <div className="App">
      <button class="notice" onclick={buttonHandler}>
        NOTICE :- We are not storing your data
      </button>
      <h1 className="header">LUCKY BIRTHDAY CALCULATOR</h1>
      <p className="intro">
        Play this game to see if your birthday is lucky or not!!!!
      </p>
      <table>
        <tbody>
          <tr>
            <th>
              <p className="datetext">Select your birthday: </p>
            </th>
            <th>
              <input
                type="date"
                name="dateinput"
                id="datei/p"
                value={date}
                onChange={assignDate}
                className="datepicker"
              />
            </th>
          </tr>
        </tbody>
      </table>
      <table>
        <tbody>
          <tr>
            <th>
              <p className="numtext">Enter your lucky number: </p>
            </th>
            <th>
              <input
                className="input"
                type="number"
                onChange={assignLucky}
              ></input>
            </th>
          </tr>
        </tbody>
      </table>
      <p />
      <p />
      <button className="btn" onClick={calculate}>
        CHECK
      </button>
      <p />
      <div className="result">{result}</div>
      <img src={imgURL} className="image" alt=""></img>

      <footer className="footer">
        <div className="footer-header">connect with me</div>
        <ul className="footer-ul-links">
          <li className="lists-item-inline">
            <a
              className="footer-links"
              href="https://linkedin.com/in/niharika-kesarwani"
              rel="noreferrer"
              target="_blank"
            >
              <FontAwesomeIcon className="icons" icon={["fab", "linkedin"]} />
              LinkedIn
            </a>
          </li>
          <li className="lists-item-inline">
            <a
              className="footer-links"
              href="https://github.com/niharika-kesarwani"
              rel="noreferrer"
              target="_blank"
            >
              <FontAwesomeIcon className="icons" icon={["fab", "github"]} />
              GitHub
            </a>
          </li>
          <li className="lists-item-inline">
            <a
              className="footer-links"
              href="https://twitter.com/Niharika_twt"
              rel="noreferrer"
              target="_blank"
            >
              <FontAwesomeIcon className="icons" icon={["fab", "twitter"]} />
              Twitter
            </a>
          </li>
          <li className="lists-item-inline">
            <a
              className="footer-links"
              href="https://niharikakesarwani.netlify.app/"
              rel="noreferrer"
              target="_blank"
            >
              <FontAwesomeIcon className="icons" icon={["fab", "dribbble"]} />
              Website
            </a>
          </li>
        </ul>
      </footer>
    </div>
  );
}
